import React from 'react';
import ReactDOM from 'react-dom/client';

class Car extends React.Component   {
    render(){
        return <p>Buy this car now!</p>;
    };
}

const header = (<div>
<header>
<h1>Fi$Pond</h1>
    <p style={{paddingRight: "5em", color: "red"}}>Your Solution, our catalog</p>
    <br/>
    <span>
        <Car/>
    </span>
</header>
</div>);

const usere = header;
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(usere);
